ism / PIP - an Introduction\nand why it matters for Effective Altruism\nand Rationality ^IYpAbolo\n\nPIP Portal Home Page ^HrAzEy3T\n\nSign up to an Intro/Mixer ^0Iv5FW7s\n\nCome to an Intro/ Mixer ^ysRVoifA\n\nGet Email ^Jj5S19gQ\n\nJoin the Community Offer ^T3QlG3Fy\n\n* Newsletter\n* Member\n* Monthly Zoom\n* Online DDP ^JOGb8lym\n\nPIP Portal Home Page\n[lesswrong.com] ^hQkoUenA\n\nWhat is PIP\n\n\nWhy is it\n\n\nJoin the community ^V4gbAaVv\n\nIs the portal home page more like a community (forum) home page\nor more information. Crudely is forum.ea.org or ea.org? ^ZyUDdP7U\n\nWe're people who are commited to X,y,Z\n\n\nPosts.   / EVents ^PxLodSyd\n\nGateway to an idea (with a community) ^E7K3qAkJ\n\nGateway to a community around an idea ^Kv7gTWlQ\n\nhttps://excalidraw.com/#room=cbed68bdcd0ef72c78b5,BHedlhnS9SpLQ_2pb_Mv7Q ^OK2GRMVn\n\nDiscover an emerging ecosystem\ncentred on a radical, alternative approach to social change ‚Äì one that is simultaneously paradigmatic, integrated and engaged. Discover key features and ideas of this growing space. Explore associated organizations, individuals and initiatives. See how it relates to other established and emerging movements.\n\nJoin the movement ... ^cqReENiX\n\nWe are a community \ncommitted to radical, alternative approaches to social change ‚Äì ones that are simultaneously paradigmatic, integrated and engaged.\n\nDiscover the key features and ideas that inspire us. Disco er associated organizations, individuals and initiatives. See how we're inspired and related to other established and emerging movements.\n\n... ^wNLwahtI\n\nMore concrete, easier to be more humble (and acknowledge this is our opinion) ^bx8nwH78\n\nMapping shows us as one initiative of this community in its efforts to make sense of the space adn share with others\n(rather than the authoritative guidebooK) ^bUQbRSyf\n\nMore: we are the authoritative guidebook to the space ^R6mXi0RL\n\nWe are a community \ncommitted to radical, alternative approaches to social change ‚Äì ones that are simultaneously paradigmatic, integrated and engaged.\n\nDiscover the key features and ideas that inspire us. Discover associated organizations, individuals and initiatives. See how we're inspired and related to other established and emerging movements.\n\n... ^kC8rqO3l\n\nPage they Land On ^5tRQsJWV\n\nHow does  \nit compare \nto X ^piMeVHSF\n\nExplore our Approach ^1vVCRM2s\n\nStart Here ^swKSVtIt\n\nCome to an Intro \u0026 Mixer ^57EG4ZG9\n\nExplore our approach\n- Manifesto\n\n- What do these ideas look like in action\n- What is this community is doing\n- What are other people saying about this?\n\nEcosystem map with different topics ... ^4ZVf0GGu\n\nHow do we make people feel safe? ^UiahX4Mc\n\nExplore our\ninspirations ^bZVapy1y\n\nStart Here ^HC4IBcu3\n\n\n* core sequence (the journey to PIP)\n* blog / manifesto of introduction\n* summary of principles\n* what do they look like in action\n* who are our inspirations/ancestors/related\n* proof that we are active, credible\n(who we are, backstory, collaborators, activities, news)\n* how to participate\n* key ideas\n* our intiatives\n* our offers ... ^8cSDBLG3\n\nOur Principles in action (applied) ^qGe5TEOQ\n\n* Example Organization Profiles\n* Course offering ^DfbHEGFc\n\nYour own life ^bhutXUNU\n\nSociety ^HuPv4oKU\n\nOur principles\n\n* Radical / Paradigmatic / Foundational\n* Integrated: Spiritual as well as Material\n* Engaged / Pragmatic\n* Primacy of Being\n* Long-termism\n* Open-minded rigor\n\nApplication areas\n\n* Work\n  * Job type\n  * Location\n  * Purpose\n  * People\n  * Teal\n* Relationships\n* Play\n* Rest\n* Learning\n* Living\n  * Where to live =\u003e City or country\n* Ideas / reading\n* Politics / understanding what is happening ^fjyddqOq\n\nWhat job?\n\nWhere could I live?\n\nHow can i have more fulfilling relationships?\n\nHow to travel / consume?\n\nReading List\n\n\nOrganizations/Resources\n\nCome to DDP ^FEztAkIV\n\nInstead of any answers can link ou
